import React from "react";
import SubjectCard from "./SubjectCard";
import StatBlock from "./StatBlock";
import ActionBlock from "./ActionBlock";

const Grid = () =>{
    return (
        <div className={"grid"}>
            <SubjectCard
                subject={props.subject}
                subjectBody="
                    A lich often haunts the abode it favored in life, such as a lonely tower,
                    a haunted ruin, or an academy of black magic. Alternatively, some liches
                    construct secret tombs filled with powerful guardians and traps.
                "
            />
            <StatBlock/>
            <ActionBlock/>
        </div>
    );
};

export default Grid;
